import './App.css';



class App extends React.Component {
  constructor() {
    super()
    this.imprimeClick1 = this.imprimeClick1.bind(this)
    this.imprimeClick2 = this.imprimeClick1.bind(this)
    this.imprimeClick3 = this.imprimeClick1.bind(this)
  }

    imprimeClick1() {
      console.log(this, 'Botão 1')
    }
    imprimeClick2() {
      console.log('Botão 2')
    }
    imprimeClick3() {
      console.log('Botão 3')
    }

    render() {
      console.log(this)
      return <div> 
        <button onClick={this.imprimeClick1} >Botão 1</button>
        <button onClick={this.imprimeClick2} >Botão 2</button>
        <button onClick={this.imprimeClick3} >Botão 3</button>
        </div>
    }
}
export default App;
